import React from "react";
import { FaStar } from "react-icons/fa";
import "./StarRating.css";
const StarRating = (props) => {
  return (
    <div className="stars">
      {[...Array(5)].map(() => (
        <input type="radio" name="star" />
      ))}
    </div>
  );
};

export default StarRating;
